  return (
    <section className="main">
      <div className="video-background">
        {/* <video autoPlay loop muted>
          <source src={video} type="video/mp4" />
        </video> */}
      </div>
      <div className="main-content">
        <p>Профессиональные решения для идеального покрытия</p>
        <button className="cta-button">Подобрать краску</button>
      </div>
    </section>
  );
};

export default Main;
